import Header from './Header'
import Page from '../pages'
const layoutStyle = {
  margin: 20,
  padding: 20,
  border: '1px solid #DDD'
}

const withLayout = (Page: any) => {
  return () => (
    <div style={layoutStyle}>
      <Header/>
      <Page/>
    </div>
  )
}

export default withLayout
